import * as categoryService from '../../../services/categoryService'

const Title = async (props) => {
    const categoryName = await categoryService.GetName(props.categoryid)
    .then(categoryName);
    console.log(categoryName);
    return (
        <div className="section-title">
            <h2>Products</h2>
            <h3>Chose from our products in <span>{ categoryName }</span></h3>
        </div>
    )
}

export default Title;
